import React from 'react';
import './App.css';

function App() {
  return (
    <div className="Parentbox">
      <div className="Foto">
        <img src="baju.jpg" />
      </div>
      <div className="Deskripsi">
        <p className="Cate">Baju Koko</p>
        <h1 className="Title">Motif Bordir Abu - Dua Kantong - Putih</h1>
        <p className="Price">IDR 243,950</p>
        <p className="Info">Regular Fit  Warna Putih Kemeja dengan Koko Bahan Katun Motif Bordir Biru Pada Placket, Dua kantong nyama dipakai di manapun kapanpun. tampil lebih gaya dan lebih religius. stok terbatas tunggu apa lagi segera beli keburu habis.
        </p>
      </div>
    </div>
  );
}

export default App;
